import axios from 'axios';
import React, { useState } from 'react';

const AddCat = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [breed, setBreed] = useState('');

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    setSelectedFile(file);
  };

  const handleBreedDetection = async () => {
    try {
      const formData = new FormData();
      formData.append('file', selectedFile);

      const API_KEY = 'YOUR_API_KEY';

      const uploadResponse = await axios.post('https://api.thecatapi.com/v1/images/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          'x-api-key': API_KEY,
        },
      });

      const uploadedImageId = uploadResponse.data.id;

      const breedResponse = await axios.get(`https://api.thecatapi.com/v1/images/${uploadedImageId}/analysis`, {
        headers: {
          'x-api-key': API_KEY,
        },
      });

      if (breedResponse.data && breedResponse.data.breeds && breedResponse.data.breeds.length > 0) {
        const detectedBreed = breedResponse.data.breeds[0].name;
        setBreed(detectedBreed);
      } else {
        setBreed('Breed not found');
      }
    } catch (error) {
      console.error('Error detecting cat breed:', error);
    }
  };

  return (
    <div className="add-cat">
      {/* Your existing code */}
      <div className="field">
        <label className="label">Image Upload</label>
        <div className="control">
          <input onChange={handleFileChange} type="file" name="file" />
          <button onClick={handleBreedDetection} disabled={!selectedFile}>Detect Breed</button>
        </div>
      </div>
      <div className="field">
        <label className="label">Breed</label>
        <div className="control">
          <input className="input" type="text" name="breed" value={breed} disabled />
        </div>
      </div>
      {/* Your remaining code */}
    </div>
  );
};

export default AddCat;
